import React from "react"
import "./Products.css"




class Products extends React.Component{

state={
    product:[
        {
        "id" : "1",
        "title":" nike shooes",
        "src":[
            "data:image/jpeg;base64, ",
             "data:image/jpeg;base64, ",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",  
        ],
        "descripation":"UI and UX desinging html css toturial",
        "content":"Saving the momey and eran the cash so let play the game and more the earing the money i think you have should be play and this game is save for you ",
        "prices" :"2555",
        "color":["red", "blue", "orange", " black"],
        "count":"1",
        }

    ],
    index:0
};

myRef = React.createRef();

handleTab = index =>{
    this.setState({ index: index})
    const images = this.myRef.current.children;
    for( let i=0; i< images.lenght; i++){
        images[1].className = images[1].className.replace("active", "");
    }
    images[index].className="active";
}
         
        

    render(){

        const {product, index} = this.state;

        return(
            <div className="app">
             {
                 product.map( item =>(
                     <div className="details">
                         <div className="big_img"> 
                          <img src={item.src[index]} alt=""/>      
                        </div> 

                        <div className="box">
                            <div className="row">
                                <h2> { item.title}</h2>
                                <span> {item.prices}</span>
                            </div> 

                            <div className="color">

                            </div>

                            <h3>{item.descripation}</h3>

                            <h4> {item.content} </h4>
                            <div className="thumb" ref={this.myRef}>
                                {
                                 
                                    item.src.map((img, index) =>(
                                        <img src={img} alt=" " key={index}
                                        onClick={ () => this.handleTab(index)}
                                        />
                                    ))
                                
                                }
                            </div>
                            <button className="cart">Add to cart</button>
                        </div>
                     </div>
                 )

                 )
             }

            </div>
        )
    }
}
export default Products;